  return ( 
        <div style={footer}>
            <div class="uk-width-1-2@s uk-width-2-5@m uk-container">
    <ul class="uk-nav uk-nav-default">
        <li class="uk-nav-header">Header</li>
        <li><a href="#">Item</a></li>
        <li><a href="#">Item</a></li>
        <li class="uk-nav-divider"></li>
        <li><a href="#">Item</a></li>
    </ul>
</div>
      </div>
  );
}

const footer = {
    backgroundColor: "#F2F3F4",
    height: "200px"
}

export default MainFooter;
